import React from "react";
import '/home/lyubomir/Documents/OnlineShop/client/src/components/Nav.css';
import {Link} from 'react-router-dom';

let Nav = () => {
    return (
        <div>
            <button className="shopping-cart">Cart</button>
            <button className="btn">Home</button>
            <button className="btn">About<Link to="/about"></Link></button>
            <button className="btn">Contacts</button>
        </div>
    );
}

export default Nav;
